import { Component } from "@angular/core";
import { ThemeService } from "./shared/services/theme.service";

@Component({
  selector: "app-root",
  templateUrl: "./app.component.html",
  styleUrls: ["./app.component.scss"],
})
export class AppComponent {
  title = "my-app";

  constructor(private readonly themeService: ThemeService) {}

  public changeTheme(theme: string): void {
    this.themeService.themeChange(theme);
  }

  public accessMenu(): void {
    console.log("Working");
  }
}
<button (click)="changeTheme('soho-light')">L</button>
<button (click)="changeTheme('soho-dark')">D</button>
<button (click)="accessMenu()"><i class="pi pi-bars"></i></button>
<button (click)="accessMenu()"><i class="pi pi-times"></i></button>

<nav>
  <a routerLink="">Home</a>
  <a routerLink="shopping">Shopping</a>
</nav>

<div>
  <app-navbar></app-navbar>
  <router-outlet></router-outlet>
</div>
